import React, { useEffect, useState } from "react";
// import Data from "./Data";
import { Link } from "react-router-dom";
import axios from "axios";

const Products = () => {
  const [getProducts, setProductsData] = useState([]);

  useEffect(() => {
    getAllProducts();
  }, []);
  const getAllProducts = () => {
    const url = "https://aveosoft-react-assignment.herokuapp.com/products";
    axios.get(`${url}`).then((res) => {
      console.log(res["data"]);
      setProductsData(res["data"]);
      // setAllProductsList(res["data"]);
    });
  };
  const products = getProducts.map((product) => {
    return (
      // <div key={product.id}>
      //   <h3>
      //     {/* <Link to={`/products/${product.id}`}>{product.name}</Link> */}
      //     <Link
      //       to={{
      //         pathname: `/products/${product.id}`
      //       }}
      //     >
      //       {product.name}
      //     </Link>
      //   </h3>
      //   <p>Price: ${product.price}</p>
      //   <hr />
      // </div>

      <div className="col-lg-4 col-md-2 col-12 mt-3">
        <div className="card" id={product.id}>
          <div className="card-body">
            <h3>
              <Link to={`/products/${product.id}`}>{product.name}</Link>
            </h3>
            <p className="card-text">
              <small className="text-muted">{product.category}</small>
            </p>
            <p className="card-text">{product.price}</p>
            <p className="card-text">{product.description}</p>
          </div>
        </div>
      </div>
    );
  });

  return (
    <>
      <div className="container">
        <div className="row">
          <h1>Products Page</h1>
          {products}
        </div>
      </div>
    </>
  );
};

export default Products;
